import React from 'react';
import { useLocation } from "react-router";

/*Componentes */
import styles from '../css/Details.module.css';

function Details(props){
    const profile = () => {
      let data = useLocation();
      console.log(data.state.fromDashboard);
    }
    return(
    <div>
      <div className={styles.row}>
        <h1 className={styles.namePropiedad}></h1>
        <h2 className={styles.directionPropiedad}>Direccion de la Propiedad</h2>
        <h3 className={styles.pricePropiedad}>USD</h3>
      </div>
        <img 
          className={styles.imagePropiedad}
          //src={require(`../images/${props.imagen}.png`)}
          alt={"Imagen de Propiedad " + props.nombre}/>
        <p className='descriptionPropiedad'>Descriopcion de la propiedad</p>
    </div>
    );
}

export default Details;
